scripts.rawScript:
// The firewall acts as an alarm system
// coordinator. When asked to close,
// it blocks the player and activates
// the punishers until it's asked to
// re-open by the alarm reset button.

// We default to open, so zap the
// 're-open' handler and wait.
zap open
go n
end

:close
    zap close
    restore open
    go s

    // Light up the room in red
    change brightblue wall brightred wall
    change brightblue breakablewall brightred breakablewall

    // The player can't use boulders
    change boulder solidwall

    // Sound the alarm
    play "+d#ff#+d#ff#-d#ff#+d#ff#"
    say "INTRUDER ALERT!"

    // Inform the others
    send punisher punish
    send reset alarm

    end

:open
    zap open
    restore close

    // Physically open
    go n

    // Dim the lighting
    change brightred wall brightblue wall
    change brightred breakablewall brightblue breakablewall

    // The player can push again
    change solidwall boulder

    // Let's be a bit nice
    change throwingstar empty
    send punisher stop

    // Tell our button to reset
    send reset pushed
    play "-sd#xd#f#a#xd#01"
    say "System reset..."
    end

:open
    say "System active."
    end
